    for i in range(begin + 1, end + 1):
        if cmp_func(lst[i], lst[begin]):
            pivot_idx += 1
            (lst[i], lst[pivot_idx]) = (lst[pivot_idx], lst[i])
    (lst[pivot_idx], lst[begin]) = (lst[begin], lst[pivot_idx])
    return pivot_idx

