    if begin == end:
        return lst[begin]
    pivot_idx = partition(lst, begin, end, cmp_func)
    if k == pivot_idx:
        return lst[k]
    elif k < pivot_idx:
        return quickselect(lst, begin, pivot_idx - 1, k, cmp_func)
    else:
        return quickselect(lst, pivot_idx + 1, end, k, cmp_func)

